%[text] ## Import Data
thisFilePath = matlab.desktop.editor.getActiveFilename;
[thisFolder, ~, ~] = fileparts(thisFilePath);

rootFolder = fileparts(thisFolder);

powerDataPath = fullfile(rootFolder, 'data', 'ErcotPowerDemand.csv');
windDataPath = fullfile(rootFolder, 'data', 'interpolated_data.csv');


windOpts = detectImportOptions(windDataPath);
powerOpts = detectImportOptions(powerDataPath);
windData = readtable(windDataPath, windOpts);
powerData = readtable(powerDataPath, powerOpts);




turbinesByCase =  [ 37.1505*1.0; % case 1    Primary reliance on wind
                    37.1505*0.9; % case 2
                    37.1505*0.8; % case 3
                    37.1505*0.7; % case 4
                    37.1505*0.6; % case 5
                    37.1505*0.5; % case 6
                    37.1505*0.4; % case 7 
                    37.1505*0.3; % case 8
                    37.1505*0.2; % case 9
                    37.1505*0.1; % case 10
                    37.1505*0.0; % case 11    Primary reliance on H2
                    ];

numTurbines = turbinesByCase(2) %[control:slider:7c7f]{"position":[30,31]} %[output:72997eae]

windTimestamp                       = windData.TIMESTAMP;
hoursFromZero                       = windData.HOURS_FROM_ZERO;
% interval                          = windData.INTERVAL;
windSpeed                           = windData.WIND_SPEED;
windSpeedAtHeight                   = windData.WIND_SPEED_AT_HEIGHT;
windSpeedRounded                    = windData.WIND_SPEED_ROUNDED;  
powerGenerated_kW                   = windData.POWER_OUTPUT_kW * numTurbines;
% energyGeneratedInterval_kWh       = windData.ENERGY_GENERATED_INTERVAL_kWh;
energyGeneratedTotal_kWh            = windData.TOTAL_ENERGY_kWh * numTurbines;
        
        
powerTimestamp                      = powerData.TIMESTAMP;
powerConsumed_mW                    = powerData.SCENT;
powerConsumedUnreduced_kW           = powerConsumed_mW * 1000; 
energyConsumedIntervalUnreduced_kWh = powerConsumedUnreduced_kW * 1;
energyConsumedTotalUnreduced_kWh    = powerData.SCENT_TOTAL_ENERGY_MWh * 1000;
% reduce load by a factor of 1000 to make numbers more digestible 
powerConsumed_kW                    = powerConsumedUnreduced_kW * 1/1000;
energyConsumedInterval_kWh          = powerConsumedUnreduced_kW * 1/1000;
energyConsumedTotal_kWh             = energyConsumedTotalUnreduced_kWh * 1/1000;




windDates  = datetime(windTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
powerDates = datetime(powerTimestamp, 'InputFormat', 'yyyy-MM-dd'' ''HH:mm:ss');
%%
%[text] ## Wind Speed Graph
figure; %[output:14c637a5]
hold on %[output:14c637a5]
plot(windDates, windSpeedAtHeight) %[output:14c637a5]
xlabel("date") %[output:14c637a5]
ylabel("wind speed (m/s)") %[output:14c637a5]
title("Speed at time"); %[output:14c637a5]
hold off %[output:14c637a5]
%%
%[text] ## Wind Power Graph
figure; %[output:4bb811e8]
hold on %[output:4bb811e8]
plot(windDates, powerGenerated_kW) %[output:4bb811e8]
xlabel("date") %[output:4bb811e8]
ylabel("power produced (kW)") %[output:4bb811e8]
title("Instantaneous Power Produced"); %[output:4bb811e8]
hold off %[output:4bb811e8]
%%
%[text] ## Wind Total Energy Graph
figure; %[output:9d12800d]
hold on %[output:9d12800d]
plot(windDates, energyGeneratedTotal_kWh) %[output:9d12800d]
xlabel("date") %[output:9d12800d]
ylabel("total energy produced (kWh)") %[output:9d12800d]
title("Total Energy Generated During 2025"); %[output:9d12800d]
hold off %[output:9d12800d]
%%
%[text] ## Consumption Power Graph
figure; %[output:520f8fd6]
hold on %[output:520f8fd6]
plot(powerDates, powerConsumed_kW) %[output:520f8fd6]
xlabel("date") %[output:520f8fd6]
ylabel("power consumed (kW)") %[output:520f8fd6]
title("Instantatenous Power Consumed"); %[output:520f8fd6]
hold off %[output:520f8fd6]
%%
%[text] ## Consumption Energy Graph
figure; %[output:67894a7c]
hold on %[output:67894a7c]
plot(powerDates, energyConsumedTotal_kWh) %[output:67894a7c]
xlabel("date") %[output:67894a7c]
ylabel("total energy consumed (kWh)") %[output:67894a7c]
title("Total Energy Consumed During 2025"); %[output:67894a7c]
hold off %[output:67894a7c]
%%
%[text] ## Surplus/Difecit Power
surplusPower = powerGenerated_kW - powerConsumed_kW;
figure; %[output:3d580758]
hold on %[output:3d580758]
plot(powerDates, surplusPower) %[output:3d580758]
yline(0, 'color', "white") %[output:3d580758]
xlabel("date") %[output:3d580758]
ylabel("instantaneous surplus power (kWh)") %[output:3d580758]
title("Surplus/Deficit Power for 2025"); %[output:3d580758]
hold off %[output:3d580758]
%%
%[text] ## Surplus/Deficit Energy
surplusEnergy = energyGeneratedTotal_kWh - energyConsumedTotal_kWh;
figure; %[output:21a93849]
hold on %[output:21a93849]
plot(powerDates, surplusEnergy) %[output:21a93849]
yline(0, 'color', "white") %[output:21a93849]
xlabel("date") %[output:21a93849]
ylabel("surplus energy (kWh)") %[output:21a93849]
title("Surplus/Deficit Energy for 2025"); %[output:21a93849]
hold off %[output:21a93849]

%%
%[text] ## Calculate Required Number of Turbines for each Case
maxPowerConsumed = max(powerConsumed_kW) %[output:3abdb9e9]
averagePowerProduced = mean(powerGenerated_kW) %[output:10cfb792]
requiredTurbines = maxPowerConsumed/averagePowerProduced %[output:99a83d67]
%%
%[text] ## Handle Converting Energy To Hydrogen
% Constants
F = 96485; % Faraday's constant (C/mol)
R = 8.314; % Ideal GaS Constant J/mol.K
T = 298.15; % Operating temperature (K)
LHV_H2_kWh_per_mol = 120 / 3600; % kWh/mol
molarMass_H2_kg = 2.016 / 1000;
E_nernst = 1.229; % Standard cell voltage (V)
cellArea_m2 = 280 / 1e4; % Convert from cm^2
N_cell = 50;


electrolyzerEfficiency = (flowRateOut_H2 * LHV_H2)/(energyInput + Q_Electrolyzer*(1-(T_Environment/T_Supplied)) + Q_H2O(1-(T_Environment/T_Supplied)))

% Calculate hydrogen storage based on surplus power and electrolyzer efficiency
H2_storage = surplusPower .* electrolyzerEfficiency * LHV_H2_kWh_per_mol / molarMass_H2_kg;


%%
%[text] ## Plot H2 Storage 
figure; %[output:5ace793c]
plot(powerDates, H2_storage); %[output:5ace793c]
xlabel('Date'); %[output:5ace793c]
ylabel('Hydrogen Stored (kg)'); %[output:5ace793c]
title('Hydrogen Storage Over Time'); %[output:5ace793c]
%%
%[text] ## Plot Electrolyzer Efficiency 
figure; %[output:343d5c62]
plot(powerDates, electrolyzerEfficiency, 'b'); %[output:343d5c62]
xlabel('Date'); %[output:343d5c62]
ylabel('Electrolyzer Efficiency'); %[output:343d5c62]
title('Electrolyzer Efficiency Over Time'); %[output:343d5c62]
ylim([0, 1]); %[output:343d5c62]
grid on; %[output:343d5c62]

